import React from "react";
import "./style.css";

export default function HeaderMenu() {

    window.addEventListener("scroll", function () {
      const scrollableElement = document.querySelector(".header-menu");

      if (window.scrollY > 0) {
        scrollableElement.classList.add("scrolled");
      } else {
        scrollableElement.classList.remove("scrolled");
      }
    });



    return (
        <div className="header-menu" id="testClass">
            <p>Home</p>
            <p>About</p>
            <p>Works</p>
        </div>
    )
}
